import React from "react";

function ProfilePic({ profileSrc }) {
    return (
        <div>
            <img
                src={profileSrc}
                alt="profile pic"
                className="md:w-[400px] md:h-[400px] rounded-full"
            ></img>
        </div>
    );
}

export default ProfilePic;
